import React, { useEffect, useState } from 'react';
import axios from 'axios';
import './AlternateAirports.css'; // ✅ Import your stylesheet

export default function AlternateAirports() {
  const [data, setData] = useState([]);
  const [error, setError] = useState(null);

  const load = () => {
    axios.get('/api/alternate_airports')
      .then(r => { setData(r.data); setError(null); })
      .catch(e => setError(e.message));
  };

  useEffect(() => { load(); }, []);

  return (
    <div className="container">
      <h2>Alternate Airports</h2>
      <button onClick={load} className="refresh-btn">Refresh</button>
      {error && <p className="error">Error: {error}</p>}

      <table className="airport-table">
        <thead>
          <tr>
            <th>City</th>
            <th>State</th>
            <th>Country</th>
            <th># Airports</th>
            <th>Codes</th>
            <th>Names</th>
          </tr>
        </thead>
        <tbody>
          {data.map((a, i) => (
            <tr key={i}>
              <td>{a.city}</td>
              <td>{a.state || '-'}</td>
              <td>{a.country}</td>
              <td>{a.num_airports}</td>
              <td>{a.airport_code_list}</td>
              <td>{a.airport_names_list}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
